import Post from '../post/Post';
import './index.css';

function Cards({ posts, setPosts }) {
    return (
        <div className="mycards">
            {posts.map((post) => {
                return (
                    <Post
                    key={post.id}    
                    post={post}
                        posts={posts}
                        setPosts={setPosts}
                    />
                )
            })}
        </div>
    )
}
export default Cards
